exportButton = document.getElementById("ExportHTML");

exportButton.addEventListener("click", function() {

  // Get the current HTML source of the page
  var pageHtml = document.documentElement.outerHTML;


  // remove menu add github me > // <
  document.querySelectorAll('.flex.py-3.px-3.items-center.gap-3').forEach(function(a) {
  
    if (a.textContent == 'Log out') {
        console.log(a.outerHTML)
        pageHtml = pageHtml.replace(a.outerHTML, github_me);
       

    }
    pageHtml = pageHtml.replace(a.outerHTML, "");
   

  })


  // Change Avatar To me >//<

  document.querySelectorAll('img').forEach(function(a) {


    pageHtml = pageHtml.replace(a.src, syNtaxp);

  })


 
  // Remove Bottom Command Element
  document.querySelectorAll('.absolute.bottom-0.left-0.w-full ').forEach(function(a) {
      pageHtml = pageHtml.replace(a.outerHTML, "");

  })


  var scripts = document.querySelectorAll("script");

  // Loop through the  script remove elements
  for (var i = 0; i < scripts.length; i++) {
      // Remove the src attribute from the script element
      pageHtml = pageHtml.replace(scripts[i].outerHTML, "");

  }

  var link = document.querySelectorAll("link");

  // Loop through the link remove elements
  for (var i = 0; i < link.length; i++) {
      // Remove the src attribute from the script element
      pageHtml = pageHtml.replace(link[i].outerHTML, "");

  }

  // Get all of the stylesheets on the page
  var stylesheets = document.styleSheets;

  // Loop through the stylesheets and add the CSS to the page content
  for (var i = 0; i < stylesheets.length; i++) {
      var stylesheet = stylesheets[i];
      var cssRules = stylesheet.cssRules

      // Loop through the CSS rules and add them to the page content
      for (var j = 0; j < cssRules.length; j++) {
          var cssRule = cssRules[j];
          pageHtml += '<style>' + cssRule.cssText + '</style>';
      }
  }

  // Create a Blob (binary large object) from the HTML source
  var blob = new Blob([pageHtml], {
      type: "text/html"
  });

  // Create a download link for the Blob
  var link = document.createElement("a");
  link.download = "ChatGPT_HTML.html";
  link.href = URL.createObjectURL(blob);

  // Click the download link
  link.click();
});


